(70458, '7D4FB4DC-F657-4B91-AEB6-73B38F943712', 'Love, sorry for being prickly last night when you asked for me to pick up Orli today. Yesterday was super stressful getting there and having to cut short my dr appt to make it on time and then Orli was tough and then I made a dinner for us that you missed/didn’t want. Making it work today also adds stress.  I appreciate you making the time for me to go to Austin and to train and do the bike ride this weekend….on Mother’s Day. Orli and I made a special gift that she will give you Sunday and I will make us a special dinner. I will be back by 4ish.', '705427113954719488', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2023-05-10T08:58:33.954720'),
(70459, 'FB2EF42B-1FE8-4B08-B59E-989375371ACA', 'Thanks love for this. I️ appreciate the apology. I️ want you to have all the things you are doing. I️ just want to make sure I️ can get in things I️ need too. Which means we have to do a bit of give and take — which we normally do quite well. I think I️’m doing a lot to accommodate an ambitious 6 weekends where you are away for 3 of them. So I️ thank you for finding ways to create space for me to get to my stuff too.  I’m sorry that I️ didn’t end up having dinner last night — it’s not always easy to know exactly when events will end and what kind of food will be there. I didn’t mean for you to prep food for me and not eat it. Just happened that way. ', '705432979607226624', '705440336380708992', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', '+19172390518', '2023-05-10T10:36:19.607227'),
